inline int ucd_grapheme_cluster_lookup(const uint32_t cp)
{
    const uint16_t s0 = s_stage0[cp >> 11];
    const uint16_t s1 = s_stage1[s0 + ((cp >> 5) & 63)];
    const uint16_t s2 = s_stage2[s1 + ((cp >> 2) & 7)];
    const uint16_t s3 = s_stage3[s2 + ((cp >> 0) & 3)];
    return s3;
}
inline int ucd_grapheme_cluster_joins(const int state, const int lead, const int trail)
{
    const int l = lead & 15;
    const int t = trail & 15;
    return (s_grapheme_cluster_join_rules[state][l] >> (t * 2)) & 3;
}
inline bool ucd_grapheme_cluster_done(const int state)
{
    return state == 3;
}
inline int ucd_grapheme_cluster_character_width(const int val)
{
    return (val >> 4) & 3;
}
inline int ucd_grapheme_cluster_is_newline(const int val)
{
    return (val & 15) > 13;
}
inline int ucd_line_break_joins(const int lead, const int trail)
{
    const int l = lead >> 6;
    const int t = trail >> 6;
    return (s_line_break_join_rules[l] >> t) & 1;
}
